    false,nt"url": null,nt"notes": "This annual narrative report for Aleutian
    Islands and Bogoslof NWRs outlines Refuge accomplishments during the 1974 fiscal
    year. The report begins by summarizing the weather conditions during the year. Wildlife-
    including migratory birds, upland game birds, big game animals, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and collections and receipts. Resource management is outlined;
    topics include grazing, fur harvesting, and commercial fishing. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge participation, and hunting.",nt"license_title":
